import React from 'react';
import { useauth } from '../Context/AuthContext';

const Testa = () => {
    const { authuser, isloggedin } = useauth();
    return (
        <div>{isloggedin ? 'Logged In' : 'Logged Out'}</div>
    );
}

export default Testa;
